import styled from 'styled-components';

export const Container = styled.div`
  display: flex;
  height: 60px;
  padding: 10px;
  justify-content: space-between;
  align-items: center;
  background: #2272a1;

  h1 {
    font-size: 20px;
    font-weight: 400;
    color: #fff;
  }

  div {
    height: 40px;
    width: 40px;
    border-radius: 50%;
    background: #fff;
  }
`;
